style.css:
body {
  font-family: 'Comic Sans MS', cursive;
  background-color: #f0f0f0;
  color: #666666;
}

h1 {
  font-size: 48px;
  text-transform: uppercase;
  letter-spacing: 5px;
  color: #ff6600;
  text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.5);
}

p {
  font-size: 24px;
  line-height: 1.5;
  text-align: justify;
}

img {
  border-radius: 50%;
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.2);
}
